import React, { useState } from 'react';
import { Link } from 'react-router-dom';

interface NavbarProps {
  cartItemCount: number;
  onCartClick: () => void;
}

const Navbar: React.FC<NavbarProps> = ({ cartItemCount, onCartClick }) => {
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);

  const toggleMobileMenu = () => {
    setMobileMenuOpen(!mobileMenuOpen);
  };

  return (
    <nav className="navbar">
      <div className="navbar-brand">
        <Link to="/">AI Photo Magic</Link>
      </div>

      <button className="mobile-menu-button" onClick={toggleMobileMenu}>
        <i className={`fas ${mobileMenuOpen ? 'fa-times' : 'fa-bars'}`}></i>
      </button>

      <div className={`navbar-links ${mobileMenuOpen ? 'open' : ''}`}>
        <Link to="/" onClick={() => setMobileMenuOpen(false)}>Home</Link>
        <Link to="/gallery" onClick={() => setMobileMenuOpen(false)}>Gallery</Link>
        <Link to="/3d-prints" onClick={() => setMobileMenuOpen(false)}>3D Prints</Link>
        <Link to="/contact" onClick={() => setMobileMenuOpen(false)}>Contact</Link>
      </div>

      <div className="navbar-cart">
        <button className="cart-button" onClick={onCartClick}>
          <i className="fas fa-shopping-cart"></i>
          {cartItemCount > 0 && (
            <span className="cart-count">{cartItemCount}</span>
          )}
        </button>
      </div>
    </nav>
  );
};

export default Navbar;
